language: go
sudo: false
go:
- '1.5'
- tip
go_import_path: github.com/codingsince1985/geo-golang
before_install:
- go get github.com/mattn/goveralls
- go get golang.org/x/tools/cmd/cover
- go get github.com/modocache/gover
- go get
script:
# For each package with test files, run with full coverage
- go list -f '"go test -covermode count -coverprofile {{.Name}}.coverprofile -coverpkg ./... {{.ImportPath}}"' ./...  | xargs -I {} bash -c {}
# Aggregate coverage files into gover.coverprofile to upload to goveralls
- gover
- goveralls -service=travis-ci -coverprofile=gover.coverprofile
env:
  global:
  # Generated encrypted environment variables of Geo API keys (won't work on forks/pull-request travis-ci builds): https://docs.travis-ci.com/user/environment-variables/#Encrypted-Variables
  # travis encrypt COVERALLS_TOKEN=XYZ --add
  # travis encrypt GOOGLE_API_KEY="XYZ" --add --append
  # travis encrypt BING_API_KEY="YZX" --add --append
  # travis encrypt HERE_APP_ID="YZX" --add --append
  # travis encrypt HERE_APP_CODE="YZX" --add --append
  # travis encrypt MAPBOX_API_KEY="YZX" --add --append
  # travis encrypt MAPQUEST_NOMINATUM_KEY="YZX" --add --append
  # travis encrypt MAPQUEST_OPEN_KEY="YZX" --add --append
